41	Aloe vera	Aloe vera	{sábila,"Sábila de Arabia","Aloe de Barbados","Aloe de Curazao"}	{"class": "Liliopsida", "genus": "Aloe", "order": "Asparagales", "family": "Asphodelaceae", "phylum": "Tracheophyta", "kingdom": "Plantae"}	Aloe vera, llamado sábila entre otros, es una especie suculenta de la familia Asphodelaceae. Con unas quinientas especies, el aloe está ampliamente distribuido y se considera una especie invasora en muchas regiones del mundo.[1]​[2]​\nEs una planta de hoja perenne, probablemente se originó en la Península Arábica, pero crece de forma silvestre en climas tropicales, semitropicales y áridos de todo el mundo.[1]​ Se cultiva para productos comerciales, principalmente como tratamiento tópico utilizado durante siglos.[1]​[2]​ La especie es atractiva con fines decorativos y tiene éxito en interiores como planta de maceta[3]​\nSe utiliza en muchos productos de consumo, incluidas bebidas, lociones para la piel, cosméticos, ungüentos o en forma de gel para quemaduras menores y quemaduras solares. Hay poca evidencia clínica de la efectividad o seguridad del extracto de Aloe vera como fármaco cosmético o tópico.[2]​[4]​\nSe debe colocar en el exterior donde  le dé la luz del sol.	{https://plant-id.ams3.cdn.digitaloceanspaces.com/knowledge_base/wikidata/462/46200b659607cd7d6cf766db0a954391ac8d775d.jpg}	active	U2cnRS5Pe0sDNg1rd0ZWZl5rCTl_SwkxQnNEc3FCWWg-	2025-08-24 21:09:21.814031-06	2025-08-24 21:09:22.064296-06
