51	Heliopsis helianthoides	Heliopsis helianthoides	{}	{"class": "Magnoliopsida", "genus": "Heliopsis", "order": "Asterales", "family": "Asteraceae", "phylum": "Tracheophyta", "kingdom": "Plantae"}	Heliopsis helianthoides es una especie de planta en la familia Asteraceae, conocido por el nombre común de falso girasol.[1]​ Es nativo del este de Norteamérica, incluyendo al este de Canadá y el este de Estados Unidos.[2]​[3]​\nEsta especie es rizomatosa herbácea perenne que crece de 40 a 150 cm (16-59 pulgadas) de altura. Las láminas de las hojas son ovales dentados para triangular o en forma de lanza y pueden ser lisas o vellosas o de una textura áspera. Las flores se producen desde mediados del verano hasta principios de otoño.[4]​ La inflorescencia contiene uno a muchos flowerheads compuestos. Cada cabeza contiene floretes amarillos rayos que son generalmente 2-4 cm de largo. En el centro hay muchos amarillo a marrón flósculos del disco. El fruto es un aquenio de unos 5 mm de largo.[2]​\nEn su hábitat natural esta planta se puede encontrar en zonas boscosas y praderas de pastos altos, y algunas veces a lo largo de las carreteras.[1]​\nSe trata de una planta de jardín popular, y varios cultivares están disponibles con flores de diferentes colores y tonalidades.  Los siguientes cultivares de H. helianthoides[5]​ han ganado el premio al Mérito Jardín de la Real Sociedad de Horticultura:\n\n'Benzinggold'[6]​\n'Light of Loddon'[7]​\n'Sonnenglut'[8]​\n'Spitzentänzerin'[9]​\n'Waterperry Gold'[10]​	{https://plant-id.ams3.cdn.digitaloceanspaces.com/knowledge_base/wikidata/6d0/6d05282d6aff162a2c0a98eb0aec173f33bf37e1.jpg}	active	CDhVZTNVAWN6SENwADMmRHpNXG4CNX9IXWRzQVBoSHA-	2025-08-24 21:10:51.823119-06	2025-08-24 21:10:53.849592-06
