94	Cajanus cajan	Cajanus cajan	{"Frijol de palo",Gandul,"Arvejón de mata"}	{"class": "Magnoliopsida", "genus": "Cajanus", "order": "Fabales", "family": "Fabaceae", "phylum": "Tracheophyta", "kingdom": "Plantae"}	El guandú, frijol de palo, frijolillo, frijol chícharo, palo de gandules o quinchoncho (Cajanus cajan) es una leguminosa arbustiva de hojas alternadas trifolioladas, similar al guisante. Se discute sobre si su origen es África o India, pero se cultiva desde hace por lo menos 3 mil años. Además, es una semilla muy saludable de ingerir y consumida en países hispanoamericanos como Colombia, Costa Rica, Ecuador, Panamá, Paraguay, Puerto Rico, República Dominicana, Venezuela, entre otros.	{https://plant-id.ams3.cdn.digitaloceanspaces.com/knowledge_base/wikidata/cde/cde103a0927d39ba7e5b7792c49704e0230bdfc6.jpg}	active	VjV4TA84XTlqWndDKk40UWxZLUhXMnRNektSazVWDGo-	2025-08-24 21:21:26.413973-06	2025-08-24 21:21:29.620577-06
96	Phaseolus coccineus	Phaseolus coccineus	{Ayocote}	{"class": "Magnoliopsida", "genus": "Phaseolus", "order": "Fabales", "family": "Fabaceae", "phylum": "Tracheophyta", "kingdom": "Plantae"}	Phaseolus coccineus, conocido como ayocote o ayecote[2]​ (nahuatlismo de ayecohtli), judía escarlata, o poroto pallar,[3]​ es una planta herbácea, anual, cultivada y originaria de México. Las variedades con flores rojas se cultivan como ornamentales. Muy próxima a P. vulgaris,[4]​ se distingue de ésta por el largo mayor de los racimos, los estigmas introrsos y los cotiledones hipógeos.[5]​ Además, contiene 1,2% de una lectina tóxica, la fitohemaglutinina, por lo que debe ser muy bien cocido antes de consumirlo.[6]​[7]​[8]​[9]​ Su raíz es conocida como cimate (nahuatlismo de címatl) y es empleada como condimento en la cocina mexicana. La palabra ayocote procede del náhuatl “ayecotli” que quiere decir frijoles gordos.	{https://plant-id.ams3.cdn.digitaloceanspaces.com/knowledge_base/wikidata/814/814601deb325995c7ac15cea2e4a55a1dcc8e861.jpg}	active	AjUoTFs4XDk.WnJDdk5jUW5ZekhQMnRNf0tba2ZWUmo-	2025-08-24 21:21:26.415721-06	2025-08-24 21:21:30.146846-06
